pragma solidity ^0.8.10;
import "./TokenVote.sol";

contract SistemaVotacion {
    //assign Token contract to variable
    TokenVote private token;
    
    mapping(address => bool) public listaYaPidieronToken;
    uint256 votosOpcion1 = 0;
    uint256 votosOpcion2 = 0;

    constructor(TokenVote _token) public {
        token = _token;
    }

    function vota(uint8 opcion) payable public {
        uint256 balanceToken = token.balanceOf(msg.sender);

        if ( balanceToken > 0){
            uint256 numVotos = balanceToken/1000000000000000000;
            if ( opcion == 1){
                votosOpcion1 = votosOpcion1+numVotos;
            }
            if ( opcion == 2){
                votosOpcion2 = votosOpcion2+numVotos;
            }
        }
    }

    function dameTokens() payable public {
        if (listaYaPidieronToken[msg.sender] != true ){
            uint256 numeroDeTokens = obtenerNumeroAleatorio() * 1000000000000000000;
            token.mint(msg.sender, numeroDeTokens);
            listaYaPidieronToken[msg.sender] = true;
        } 
    }

    function getVotosOpcion1() public view returns (uint256) {
        return votosOpcion1;
    }

    function getVotosOpcion2() public view returns (uint256) {
        return votosOpcion2;
    }


  function obtenerNumeroAleatorio() private returns (uint8) {
        uint256 randomNumber = uint8(uint(keccak256(abi.encodePacked(block.timestamp, block.difficulty))) % 10) + 1;
        return uint8(randomNumber);
   }
}
